import { Route } from 'react-router-dom'

import Welcom from './components/Welcome';

import Product from './components/Products';

function App() {
  return (
    <div>
      <Route path='/welcome'>
        <Welcom />
      </Route>
      <Route path='/product'>
        <Product/>
      </Route>
    </div>
  );
}

export default App;
